import React, { useEffect, useState } from 'react';
import { SiWhatsapp } from "react-icons/si";
import { useParams } from 'react-router-dom';
import api from '../services/api';

import '../styles/components/list.css';

interface Orphanage {
    id: number;
    latitude: number;
    longitude: number;
    name: string;
}
function Profile(){
    const [orphanages, setOrphanages] = useState<Orphanage[]>();

    // execute a função quando a variavel no [] tiver alterado
    useEffect(() => {
        api.get('orphanages').then(response => {
            setOrphanages(response.data);
        })
    }, []);

    console.log(orphanages)

      if (!orphanages) {
        return <p>Carregando...</p>
      }

     
  
    return(
       
        <article className="list">

        <header>
            <img src="https://avatars0.githubusercontent.com/u/49418565?s=460&u=caa6add820c3e5842ba889673008612e15261857&v=4" alt="Juan Andrade"/>
             <div className="">
                 <strong>
                 {orphanages.map(orphanage => {
                                 return (
                                       <h1 
                                       className="list"
                                       key={orphanage.id}
                                       >{[orphanage.name]}</h1>

          
                                    );
                                  })}

                     

                      <span>Html </span>
                     </strong>
             </div>
        </header>
             <p>Designer grafico
                 <br/> <br/>
                texto texto texto texto texto texto texto texto texto texto texto texto texto texto texto texto texto texto texto texto texto 
             </p>

             <footer>
                 <p>Preço por Hora
                     <strong>R$ 2,50</strong>
                 </p>
                 <button type="button">
                      <SiWhatsapp />
                     <p> Entrar em contado </p>
                 </button>
             </footer>
             <div className="space">
                 __________________________________________________________________________
             </div>
             
    </article>
    );

}

export default Profile;
